    >>> intersperse([], 4)
    []
    >>> intersperse([1, 2, 3], 4)
    [1, 4, 2, 4, 3]
    """
    # Python 2.7
    if not isinstance(delimeter, int):
        raise TypeError('Delimeter argument must be an integer.')
    else:
        nums = list(numbers)
