    # avoid nasty recursion!
    while len(numbers):
        if not numbers:
            return []
        elif len(numbers) == 1:
            # first number
            if numbers[0]!= delimeter:
                return [delimeter] + intersperse(numbers[1:], delimeter)
        else:
            # every number
            return [delimeter] + intersperse(numbers[:delimeter], delimeter)
